function replaceJobSeeker(str, name) {
  // 定义目标字符串和替换文本
  const target = "{求职者}";
  const replacement = name;

  // 判断字符串是否包含目标文本
  if (str.includes(target)) {
    // 使用正则表达式进行全局替换（需转义特殊字符）
    return str.replace(/\{求职者\}/g, replacement);
  }
  // 不包含时直接返回原字符串
  return str;
}
/**
 * 获取中文名称的第一个字（处理复姓情况）
 * @param {string} name 中文姓名
 * @returns {string} 姓氏（单姓或复姓）
 */
function getChineseSurname(name) {
    if (!name || typeof name !== 'string' || name.trim().length === 0) {
        return '';
    }

    name = name.trim();

    // 先检查是否为复姓（优先匹配更长的复姓）
    for (let i = 0; i < compoundSurnames.length; i++) {
        const surname = compoundSurnames[i];
        if (name.startsWith(surname)) {
            return surname;
        }
    }

    // 不是复姓则返回第一个字符（处理4字节Unicode字符）
    return [...name][0];
}

