  },
  {
    name:'学历要求',
    mitClicks: educationalValue.filter(item => item > 0).map(item => item - 1)
  },
  {
    name:'薪资待遇[单选]',
    mitClicks: salaryValue.filter(item => item > 0).map(item => item - 1)
  },
  {
    name:'求职意向',
    mitClicks: jobIntentionValue.filter(item => item > 0).map(item => item - 1)
  },
]

const iframe = document.getElementsByTagName('iframe')[0]; 
if (iframe) {
  // 获取iframe的document
  const iframeDoc = iframe.contentDocument || iframe.contentWindow.document;
  const filterDoc = iframeDoc.querySelectorAll('.filters-wrap')[1];
  // 获取所有filter-item元素
  const filterItems = filterDoc.querySelectorAll('.filter-item');

  // 经验有没有9个？
  // 获取父元素
  const experience_optionsContainer = filterDoc.querySelector('.filter-wrap >.experience > .options').querySelectorAll('.option');

  // 遍历数组对象
  arr.forEach(item => {
    const matchedFilter = Array.from(filterItems).find(filter => {
      const nameElement = filter.querySelector('.name');
      return nameElement && nameElement.textContent === item.name;
    });

    if (matchedFilter) {
      const optionsContainer = matchedFilter.querySelector('.options');
      console.log(optionsContainer,'optionsContainer')
      if (optionsContainer) {
        const options = Array.from(optionsContainer.querySelectorAll('.option, .popover .option'));
        for (let i = 0; i < item.mitClicks.length; i++) {
          if (item.mitClicks[i] < options.length) {
            setTimeout(() => {
              options[item.mitClicks[i]].click();
            },500)
          }
        }
      }
    }
  });
}

