function checkWorkGapWithinLimit(htmlString, gapLimitMonths) {
    // 解析HTML字符串，提取时间信息
    function extractTimeRanges(html) {
        const parser = new DOMParser();
        const doc = parser.parseFromString(html, 'text/html');
        const timeElements = doc.querySelectorAll('.time.join-text-wrap');

        const timeRanges = [];
        timeElements.forEach(element => {
            // 获取所有文本节点，跳过HTML标签
            const textNodes = [];
            element.childNodes.forEach(node => {
                if (node.nodeType === Node.TEXT_NODE) {
                    const text = node.textContent.trim();
                    if (text) {
                        textNodes.push(text);
                    }
                }
            });

            // 将文本节点组合成时间范围
            if (textNodes.length >= 2) {
                const timeRange = `${textNodes[0]}-${textNodes[1]}`;
                timeRanges.push(timeRange);
            }
        });

        return timeRanges;
    }

    // 解析时间字符串为日期对象
    function parseTimeRange(timeStr) {
        console.log('正在解析时间:', timeStr); // 调试信息

        // 分割开始时间和结束时间
        const parts = timeStr.split('-');

        if (parts.length !== 2) {
            console.log('时间格式错误:', timeStr);
            return null;
        }

        const startStr = parts[0].trim();
        const endStr = parts[1].trim();

        // 解析开始时间
        const startMatch = startStr.match(/(\d{4})\.(\d{1,2})/);
        if (!startMatch) {
            console.log('开始时间解析失败:', startStr);
            return null;
        }

        const startDate = new Date(parseInt(startMatch[1]), parseInt(startMatch[2]) - 1, 1);

        // 解析结束时间
        let endDate;
        if (endStr === '至今') {
            endDate = new Date(); // 当前时间
        } else {
            const endMatch = endStr.match(/(\d{4})\.(\d{1,2})/);
            if (!endMatch) {
                console.log('结束时间解析失败:', endStr);
                return null;
            }
            endDate = new Date(parseInt(endMatch[1]), parseInt(endMatch[2]) - 1, 1);
        }

        console.log('解析成功:', { start: startDate, end: endDate });

        return {
            start: startDate,
            end: endDate,
            isCurrent: endStr === '至今'
        };
    }

    // 计算两个日期之间的月数差
    function getMonthsDifference(date1, date2) {
        const years = date2.getFullYear() - date1.getFullYear();
        const months = date2.getMonth() - date1.getMonth();
        return years * 12 + months;
    }

    // 主逻辑
    try {
        const timeRanges = extractTimeRanges(htmlString);
        console.log('提取到的时间范围:', timeRanges); // 调试信息

        const workPeriods = [];
        let hasCurrentJob = false;

        // 解析所有工作时间段
        for (const timeRange of timeRanges) {
            const parsed = parseTimeRange(timeRange);
            if (parsed) {
                workPeriods.push(parsed);
                if (parsed.isCurrent) {
                    hasCurrentJob = true;
                }
            }
        }

        console.log('解析后的工作时间段:', workPeriods); // 调试信息

        if (workPeriods.length === 0) {
            console.log('没有有效的工作经历');
            return false; // 没有有效的工作经历
        }

        // 按开始时间排序
        workPeriods.sort((a, b) => a.start.getTime() - b.start.getTime());

        if (hasCurrentJob) {
            // 如果有"至今"的工作，计算工作经历中的最长空窗期
            let maxGapMonths = 0;

            for (let i = 0; i < workPeriods.length - 1; i++) {
                const currentEnd = workPeriods[i].end;
                const nextStart = workPeriods[i + 1].start;

                // 计算当前工作结束和下一个工作开始之间的空窗期
                const gapMonths = getMonthsDifference(currentEnd, nextStart);

                if (gapMonths > 0) {
                    maxGapMonths = Math.max(maxGapMonths, gapMonths);
                }
            }

            console.log('最长空窗期:', maxGapMonths, '个月');
            return maxGapMonths < gapLimitMonths;
        } else {
            // 如果没有"至今"的工作，计算最近工作结束到现在的空窗期
            const latestWork = workPeriods[workPeriods.length - 1];
            const currentDate = new Date();
            const gapMonths = getMonthsDifference(latestWork.end, currentDate);

            console.log('距离最近工作结束的空窗期:', gapMonths, '个月');
            return gapMonths < gapLimitMonths;
        }

    } catch (error) {
        console.error('解析工作经历时出错:', error);
        return false;
    }
}
