function extractPersonInfo(htmlString) {
    // 创建一个临时的DOM元素来解析HTML
    const parser = new DOMParser();
    const doc = parser.parseFromString(htmlString, 'text/html');

    // 获取所有div元素的文本内容
    const divs = doc.querySelectorAll('div');
    const textContents = Array.from(divs).map(div => div.textContent.trim()).filter(text => text);

    // 合并所有文本内容，用于统一匹配
    const allText = textContents.join(' ');

    const result = {
        age: null,
        experience: null,
        education: null
    };

    // 提取年龄 - 匹配"数字+岁"的模式
    const ageMatch = allText.match(/(\d+)岁/);
    if (ageMatch) {
        result.age = ageMatch[1] + '岁';
    }

    // 提取经验年限 - 匹配"数字+年"或"数字+年以上"的模式
    const experienceMatch = allText.match(/(\d+年以上|\d+年)/);
    if (experienceMatch) {
        result.experience = experienceMatch[1];
    }

    // 提取学历 - 匹配常见学历关键词
    const educationKeywords = [
        '博士', '硕士', '本科', '专科', '高中', '中专', '技校', 
        '初中', '小学', '大专', '研究生', '学士', 'MBA', 'EMBA'
    ];

    for (const keyword of educationKeywords) {
        if (allText.includes(keyword)) {
            result.education = keyword;
            break; // 取第一个匹配到的学历
        }
    }

    return result;
}

