const chat_title_job = automaRefData('variables', 'chat_title_job') || null;
function extractJobInfo(htmlString) {
    // 创建DOM解析器
    const parser = new DOMParser();
    const doc = parser.parseFromString(htmlString, 'text/html');

    // 查找包含job信息的元素（class包含'job'的元素）
    const jobElement = doc.querySelector('[class*="job"]');

    if (!jobElement) {
        return {
            location: null,
            position: null,
            salary: null,
            error: '未找到包含job信息的元素'
        };
    }

    // 提取薪资信息（从class包含'high-light-orange'的元素中获取）
    const salaryElement = jobElement.querySelector('[class*="high-light-orange"]');
    const salary = salaryElement ? salaryElement.textContent.trim() : null;

    // 获取主要文本内容（排除内部标签的文本）
    let mainText = '';
    for (let node of jobElement.childNodes) {
        if (node.nodeType === Node.TEXT_NODE) {
            mainText += node.textContent;
        }
    }

    // 按 " · " 分割地点和岗位
    const parts = mainText.split(' · ').map(part => part.trim()).filter(part => part);

    const location = parts.length > 0 ? parts[0] : null;
    const position = parts.length > 1 ? parts[1] : null;

    return {
        location: location,
        position: position,
        salary: salary
    };
}
